          title="React.js"
        />
        <Card2
          key={3}
          bulletPoints={["BulletPoint1", "BulletPoint2", "BulletPoint3"]}
          logo={ReactLogo}
          title="React.js"
        />
        <Card2
          key={4}
          bulletPoints={["BulletPoint1", "BulletPoint2", "BulletPoint3"]}
          logo={ReactLogo}
          title="React.js"
        />
      </div>
    </>
  );

  return <PublicRoute content={content} />;
};

export default Skills;
